export function ProductRow(props) {
    return (
        <>
            {
                props.data.map((row, index) => {
                    if (row.category === props.category) {
                        <ProductRowRender name={row.name} price={row.price} />
                    }
                })

            }
        </>
    )
}

function ProductRowRender(props) {
    return (
        <>
            <tr>
                <td>{props.name}</td>
                <td>{props.price}</td>
            </tr>
        </>
    )
}
